import React from 'react';
import { View, Text } from 'react-native';

const English = ({ navigation }) => {
    return(
        <View style={{marginVertical:50, marginHorizontal:40}}>
            <Text style={{fontSize:20}}>English Screen !!!</Text>
        </View>
    )
}

export default English
